import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import { useAuth } from "./useAuth"; // Импортируем хук аутентификации
import "../css/Home.css";

const Home = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [loginError, setLoginError] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const { isAuthenticated, login } = useAuth(); // Используем хук аутентификации
  const navigate = useNavigate();

  useEffect(() => {
    if (isAuthenticated) {
      const loadData = async () => {
        try {
          const response = await axios.get("http://localhost:5000/api/items");
          setData(response.data);
          setLoading(false);
        } catch (error) {
          if (error.response) {
            setError(error.response.data.message || "An error occurred while loading data.");
          } else if (error.request) {
            setError("No response from the server. Please try again later.");
          } else {
            setError("An unexpected error occurred.");
          }
          setLoading(false);
        }
      };

      loadData();
    }
  }, [isAuthenticated]);

  const handleLogin = async (e) => {
    e.preventDefault();
    const result = await login(username, password);
    if (!result.success) {
      setLoginError(result.error);
    } else {
      navigate("/"); // Перенаправляем на главную страницу после входа
    }
  };

  if (!isAuthenticated) {
    return (
      <div className="login-container">
        <form onSubmit={handleLogin} className="login-form">
          <h2>Login</h2>
          {loginError && <p className="error-message">{loginError}</p>}
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <button type="submit">Login</button>
        </form>
      </div>
    );
  }

  return (
    <div className="home-container">
      <div className="home-header">
        <h1 className="home-title">Device List</h1>
        <Link to="/add" className="add-device-button">
          Add Device
        </Link>
      </div>

      {loading ? (
        <div className="loading-state">
          <div className="spinner"></div>
          <p>Loading devices...</p>
        </div>
      ) : error ? (
        <div className="error-state">
          <p>{error}</p>
        </div>
      ) : data.length === 0 ? (
        <div className="empty-state">
          <p>No devices found. Add your first device!</p>
        </div>
      ) : (
        <div className="device-list">
          {data.map((item) => (
            <Link
              to={`/detail/${item.id}`}
              className="device-card"
              key={item.id}
            >
              <div className="device-icon">
                {/* Используем Unicode символ */}
                <span className="icon-circle">&#9679;</span>
              </div>
              <div className="device-info">
                <h3>{item.name}</h3>
                <p className="device-type">{item.type || 'Unknown type'}</p>
                <p className="device-status">
                  <span className={`status-indicator ${item.status || 'inactive'}`}>
                    {item.status || 'Inactive'}
                  </span>
                </p>
              </div>
            </Link>
          ))}
        </div>
      )}
    </div>
  );
};

export default Home;
